/* home page for admins */

export default function Profile() {

    const firstName = "Will";
    const lastName= "Smith";
    const userName= "Will123";
    const email = "WillSmith456@gmail.com";
    const password = "********";
    const homeAddress = "123 PennyLane lane";
    const homeZip= "30567";
    const homeState= "GA";
    const phone= "4042344455";

    const cardNumber_1 = "1111333355556666";
    const cardName_1 = "Will Smith";
    
    const cardNumber_2 = "1111333355556666";
    const cardName_2 = "Bobby Lee"

/* if card number is "" then I do not display: I am assuming that the card either has information or it is an empty string. I guess default make all credit card info contain empty string*/
    const cardNumber_3 = "";
    const cardName_3 = "";

    function handleSubmit(e) {
        e.preventDefault();
        console.log('You clicked submit.');
      }


    return (
        <body className= "editP"> 
            <h1 style={{paddingBottom:'20px'}}>Profile</h1>
            <div classname= "firstName" style={{paddingBottom:'10px'}}>
            First Name: {firstName}
            </div>
            <div classname= "lastName" style={{paddingBottom:'20px'}}>
            Last Name: {lastName}
            </div>
            <div classname= "lastName" style={{paddingBottom:'20px'}}>
            Username: {userName}
            </div>
            <div classname= "email" style={{paddingBottom:'20px'}}>
            Email: {email}
            </div>
            <div classname= "password" style={{paddingBottom:'20px'}}>
            Password: {password}
            </div>

            <div classname= "homeAddress" style={{paddingBottom:'20px'}}>
            <p>Home Address</p>
            <p>Street: {homeAddress}</p>
            <p>Zip: {homeZip}</p>
            <p>State: {homeState}</p>
            </div>

            <div classname= "phone" style={{paddingBottom:'20px'}}>
            Phone Number: {phone}
            </div>

            <div style={{paddingBottom:'50px'}}>
            <a  href = "/editProfile">Edit Profile </a><br/>
            </div>

            <div classname= "phone" style={{paddingBottom:'20px'}}>
            Payment Options
            </div>

            {(cardNumber_1 !== "") &&
                <div classname= "payment-info" style={{paddingBottom:'20px'}}>
                    <p>{cardName_1}</p>
                    Card ending in: ****{cardNumber_1.slice(-4)}
                </div>
            }
            
            {(cardNumber_2 !== "") &&
                <div classname= "payment-info" style={{paddingBottom:'20px'}}>
                    <p>{cardName_2}</p>
                    Card ending in: ****{cardNumber_2.slice(-4)}
                </div>
            }

            {(cardNumber_3 !== "") &&
                <div classname= "payment-info" style={{paddingBottom:'20px'}}>
                    <p>{cardName_3}</p>                    
                    Card ending in: ****{cardNumber_3.slice(-4)}
                </div>
            }
              
        </body>
    )
}
